import React from 'react';
import {BrowserRouter as Router,Routes,Route} from "react-router-dom"
import './App.css';
import Login from './components/login';
import Home from './components/Home';

function App() {
  return (
    <div className="App">
      <Login/>
      <Routes>
        <Route path="/" element= {Login}/>
        </Routes>  
    </div>
  );
}

export default App;
